🎶🎤 Atlanta’s music industry wouldn’t be the same without the hard work and determination of @missmarto , a true trailblazer in the game. With over 20 years of experience as a music executive and multiple business owner, Dina founded Twelve Music & Studios in 2012 and has helped with chart-topping hits for some of the biggest names in the industry.

Her success wouldn’t have been possible without her hard work, determination, creativity, diversity, and values that we at Focus In Network stand for. Additionally, we’re inspired by Dina’s commitment to empowering minority women, as demonstrated by her partnership with marketing guru Courtney Rhodes to form C&D The Agency in 2020, an all women-led management agency. We’re proud to showcase Dina’s story and support her mission of uplifting and empowering others. 

#FocusInNetwork #WomenInMusic #EntrepreneurMindset #ImFocused  #DiversityAndInclusion #ATLMusicScene 🎶🎤

